dfp_read_field_def_Goals(Other, Z1, Z2, F, F@_1, TrUserData) -> dg_read_field_def_Goals(Other, Z1, Z2, F, F@_1, TrUserData).

dg_read_field_def_Goals(<<1:1, X:7, Rest/binary>>, N, Acc, F, F@_1, TrUserData) when N < 32 - 7 -> dg_read_field_def_Goals(Rest, N + 7, X bsl N + Acc, F, F@_1, TrUserData);
dg_read_field_def_Goals(<<0:1, X:7, Rest/binary>>, N, Acc, _, F@_1, TrUserData) ->
    Key = X bsl N + Acc,
    case Key of
        10 -> d_field_Goals_goals(Rest, 0, 0, 0, F@_1, TrUserData);
        _ ->
            case Key band 7 of
                0 -> skip_varint_Goals(Rest, 0, 0, Key bsr 3, F@_1, TrUserData);
                1 -> skip_64_Goals(Rest, 0, 0, Key bsr 3, F@_1, TrUserData);
                2 -> skip_length_delimited_Goals(Rest, 0, 0, Key bsr 3, F@_1, TrUserData);
                3 -> skip_group_Goals(Rest, 0, 0, Key bsr 3, F@_1, TrUserData);
