merge_msg_Goals(#'Goals'{goals = PFgoals}, #'Goals'{goals = NFgoals}, TrUserData) ->
    #'Goals'{goals =
                 if PFgoals /= undefined, NFgoals /= undefined -> 'erlang_++'(PFgoals, NFgoals, TrUserData);
