verify_msg(Msg) when tuple_size(Msg) >= 1 -> verify_msg(Msg, element(1, Msg), []);
verify_msg(X) -> mk_type_error(not_a_known_message, X, []).

verify_msg(Msg, MsgName) when is_atom(MsgName) -> verify_msg(Msg, MsgName, []);
verify_msg(Msg, Opts) when tuple_size(Msg) >= 1 -> verify_msg(Msg, element(1, Msg), Opts);
verify_msg(X, _Opts) -> mk_type_error(not_a_known_message, X, []).

verify_msg(Msg, MsgName, Opts) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case MsgName of
        'Goal' -> v_msg_Goal(Msg, [MsgName], TrUserData);
        'Goals' -> v_msg_Goals(Msg, [MsgName], TrUserData);
        _ -> mk_type_error(not_a_known_message, Msg, [])
    end.


-compile({nowarn_unused_function,v_msg_Goal/3}).
-dialyzer({nowarn_function,v_msg_Goal/3}).
v_msg_Goal(#'Goal'{id = F1, player_id = F2, f3 = F3, name = F4, type = F5, periodicity = F6, target_distance = F7, target_duration = F8, actual_distance = F9, actual_duration = F10, created_on = F11, period_end_date = F12, f13 = F13}, Path,
           TrUserData) ->
    if F1 == undefined -> ok;
       true -> v_type_uint64(F1, [id | Path], TrUserData)
    end,
    if F2 == undefined -> ok;
       true -> v_type_uint64(F2, [player_id | Path], TrUserData)
    end,
    if F3 == undefined -> ok;
       true -> v_type_uint32(F3, [f3 | Path], TrUserData)
    end,
    if F4 == undefined -> ok;
       true -> v_type_string(F4, [name | Path], TrUserData)
    end,
    if F5 == undefined -> ok;
       true -> v_type_uint32(F5, [type | Path], TrUserData)
    end,
    if F6 == undefined -> ok;
       true -> v_type_uint32(F6, [periodicity | Path], TrUserData)
    end,
    if F7 == undefined -> ok;
       true -> v_type_float(F7, [target_distance | Path], TrUserData)
    end,
    if F8 == undefined -> ok;
       true -> v_type_float(F8, [target_duration | Path], TrUserData)
    end,
    if F9 == undefined -> ok;
       true -> v_type_float(F9, [actual_distance | Path], TrUserData)
    end,
    if F10 == undefined -> ok;
       true -> v_type_float(F10, [actual_duration | Path], TrUserData)
    end,
    if F11 == undefined -> ok;
       true -> v_type_uint64(F11, [created_on | Path], TrUserData)
    end,
    if F12 == undefined -> ok;
       true -> v_type_uint64(F12, [period_end_date | Path], TrUserData)
    end,
    if F13 == undefined -> ok;
       true -> v_type_uint64(F13, [f13 | Path], TrUserData)
    end,
    ok;
v_msg_Goal(X, Path, _TrUserData) -> mk_type_error({expected_msg, 'Goal'}, X, Path).

-compile({nowarn_unused_function,v_msg_Goals/3}).
-dialyzer({nowarn_function,v_msg_Goals/3}).
v_msg_Goals(#'Goals'{goals = F1}, Path, TrUserData) ->
    if is_list(F1) ->
           _ = [v_msg_Goal(Elem, [goals | Path], TrUserData) || Elem <- F1],
           ok;
       true -> mk_type_error({invalid_list_of, {msg, 'Goal'}}, F1, [goals | Path])
    end,
    ok;
v_msg_Goals(X, Path, _TrUserData) -> mk_type_error({expected_msg, 'Goals'}, X, Path).

